    groups = {}
    unassigned = [1, 2, 3, 4]

    while unassigned:
        min_diff = float('inf')
        min_pair = None

        for i in unassigned:
            for dawnich in davnichi:
                difference = abs(i - dawnich)
                if difference < min_diff:
                    min_diff = difference
                    min_pair = (i, dawnich)

        if min_pair:
            unassigned.remove(min_pair[0])
            davnichi[min_pair[1]] = min_pair[0]
